def NoDistChar(S):
	cntr=0
	for x in S:
		if S[0]==x:
			cntr+=1
	if cntr>=2 and cntr<=4:
		return True
	else:
		return False

def DistChar(S):
	L=[]
	result=0
	for x in S:
		if not x in L:
			L.append(x)
			result+=1
	return result		

